import "semantic-ui-css/semantic.min.css";
import React, { useState } from "react";
import { Grid, Header, Segment } from "semantic-ui-react";

import ApiCall from "../api/ApiCall.js";

const style = {
  h1: {
    marginTop: "2em",
    fontSize: "35px",
  },
};

function IqAir() {
  const [airQuality, setAirQuality] = useState({});
  return (
    <div>
      <ApiCall setData={setAirQuality}>
        http://api.airvisual.com/v2/nearest_city?key=7b8930b6-8d0c-4fb6-a63b-da7c8e2ed6c7
      </ApiCall>
      <Header as="h1" content="API IqAir" textAlign="center" style={style.h1} />
      <Grid columns={1} stackable>
        <Grid.Row columns={2}>
          <Grid.Column></Grid.Column>
          <Grid.Column>
            <Segment>{console.log(typeof airQuality.status)}</Segment>
          </Grid.Column>
          <Grid.Column></Grid.Column>
        </Grid.Row>
      </Grid>
    </div>
  );
}

export default IqAir;
